import React from 'react';

import { Container, Col, Row } from 'react-bootstrap';

export default function Article(props) {
    return (
        <Container>
            <Row>
                <Col>
                    {props.articleTitle}
                </Col>
                <Col>
                    {props.articleContent}
                </Col>

            </Row>
        </Container>
    );
}
